import { fetchStocksBegin } from "./stockActions";

export function fetchStockSearchData() {
  return dispatch => {
    dispatch(fetchStocksBegin());
    return fetch("./companylist.csv")
    .then(res => {
      console.log(res);
    });
  }
}

export function handleErrors() {

}
